export const aboutStyle = `
    display: flex;
    align-items:center;
    color: black;
    font-family: 'Raleway', 'sans-serif';
    font-weight: normal;
    font-size:14px;
    `;

export const imageStyle = `
    object-fit: cover;
    width:100%;
    height: auto;
    border-radius:20px;
    `;

export const avatarStyle = `
    margin-right: 10px;
    width: 20%;
    height:20%;
    border-radius: 50%;
    `;

export const modalBtnStyle = `
    width:100px;
    height:30px;
    padding: 2px;
    border-radius: 20px;
    color: white;
    background-color:brown;
    cursor:pointer;
    border: none;
    margin-bottom: 30px;`
